import React, { useState } from 'react';
import PropTypes from 'prop-types';
import './Login.css';
import User from './User';
import authService from '../services/authService';

async function loginUser(user:User) {
  console.log('inside login')
 return authService.login(user);
}

export default function Login() {
  const [username, setUserName] = useState("");
  const [password, setPassword] = useState("");

  const handleSubmit = async () => {
    var user={
      user:username,
      password:password
    };
  // loginUser(user);
console.warn(username,password);

  let result=await fetch("http://localhost:8090/api/Auth",{
    method:'POST',
    headers:{
      'Content-Type':'application/json'
    },
    body:JSON.stringify(user)
  });

  result=await result.json();
 localStorage.setItem("access_token",JSON.stringify(result));
  }

  return(
    <div className="login-wrapper">
      <h1>Please Log In</h1>
      <form onSubmit={handleSubmit}>
        
        
          <input type="text" className='form-control' placeholder='User Name' onChange={(e)=>setUserName(e.target.value)} />
       
       
         
          <input type="password" className='form-control' placeholder='Password' onChange={(e)=>setPassword(e.target.value)}/>
      
        <div>
          <button type="submit" className='btn btn=prinary'>Submit</button>
        </div>
      </form>
    </div>
  )
}

